[Duke Nukem 3D Kill a Ton Collection]

Duke Nukem 3D ripped right from the cd and works great if you are using Windows XP, or Windows Vista then in order to play it use eduke. If you are using Windows 98, through 2000 then dont use eduke.

Reason why to use eduke.
-------------------------

Because of the oldness of Duke Nukem 3D it runs in dos mode and on Windows XP and Vista they wont allow it to run in fullscreen and Eduke doesnt use dos to run.

If you dont have eduke they go here to download it: http://sourceforge.net/project/showfiles.php?group_id=126745

